import { ChangeEvent, useEffect, useState } from "react";
import { SuperHero } from "../types";

interface SuperheroDetail {
  superheroInfo: SuperHero;
}

function SuperheroDetails(props: SuperheroDetail) {
  const superheros = props.superheroInfo;

  const [name, setName] = useState<SuperheroDetail>();

  const toggleImage = () => setName(!name);

  useEffect(() => {
    console.log("effect will run once");
  }, []);

  useEffect(() => {
    console.log("effect will always run");
  });

  return (
    <>
      <div className="test">
        <button onClick={toggleImage}>Toggle Image</button>

        {name && (
          <img
            src="http://www.funnycatsite.com/pictures/Jumping_For_Big_Joy.jpg"
            alt="Cat"
          />
        )}
        <h2>{superheros.name}</h2>
        <p>{superheros.description}</p>
      </div>
    </>
  );
}

export default SuperheroDetails;
